const MAX_LUMINANCE = 115
// number of sample points
const NUMBER_POINTS = 3000

const WIDTH = image.width()
const HEIGHT = image.height()

const rng = random()
// const rng = xorshift()
const svg = Svg.create({ width: WIDTH, height: HEIGHT })

// generate n random points based on luminance
let points: Vector<2>[] = []
for (let i = 0; i < NUMBER_POINTS; i++) {
  const x = rng.integer(WIDTH - 1)
  const y = rng.integer(HEIGHT - 1)
  if (image.get(x, y).luminance() < rng.integer(MAX_LUMINANCE)) {
    points.push(vec(x, y))
  } else {
    i--
  }
}

const vor = Voronoi.create(points, [0, 0, WIDTH, HEIGHT])
points = vor.weightedStippling((x, y) => image.get(x, y).luminance(), 1)

// vector field
function field({ x, y }: Vector<2>) {
  // TODO: use simplex
  // simplex(x, y)
  return vec(y, -x + y)
  // return vec(y, -(x ** 2) + y)
}

const rand = boxMuller(0.5, 0.15)
for (const p of points) {
  const linePoints = [p.clone()]
  console.log(rand.integer(3, 15))
  for (let i = 0; i < rand.integer(3, 30); i++) {
    const v = p.clone().sub(vec(600, 400)).div(30)
    const d = field(v).norm().mul(5)
    p.add(d)
    linePoints.push(p.clone())
  }
  svg.curve(linePoints, { fill: 'none', strokeWidth: 2 })
}

load(svg)
